import React from 'react'
import './RightSidebar.css'

function RightSidebar() {
  return (
    <div className='right-sidebar'>
      <div className="name-box">Click on Exam</div>
      <div className="add-to-radar-box"></div>
    </div>
  )
}

export default RightSidebar;
